import React from 'react';
import './About.css';
import logo from './pngegg.png';

const About = () => {
    return (
        <div className="about">
            <h2>Trading Network</h2>
            <p>This is an open-source project created by <i><a target="_blank" href="https://www.linkedin.com/in/lyubomir-stamenov-1b97a61b4/">Lyubomir Stamenov.</a></i> 
             Link to the GitHub Repository <i><a target="_blank" href="#">here</a></i>. 
            </p>
            <h2 id="contact-me">Contact me</h2>
        </div>
    );
}

export default About;
